Ever seen Black burlesque and drag together? In LA? with a live R&B band? served up with specialty cocktails? with a DJ playing R&B jams to dance to all night long? And all put on by a team of Badass women of colour?!!! 

No? Well here’s your chance! The third (and possibly last instalment for 2023) of @thebrownsugarburlesque at @checkerhall 

Live band jams provided by @deltasoulentertainment 
Performances by:
@theambercrane 
@ivory_onyx 
