“The Soulful Sex Appeal of Jessabelle Thunder and Brown Sugar Burlesque” an article by the amazing LA icon @linalecaro 

I had a blast at @montrealburlesquefest this weekend THEN flew back for an epic night with @thebrownsugarburlesque last night. I am exhausted but wanted to share a little something something. Thank you @linalecaro for writing about me and the show. If you missed this last Brown Sugar of the year, you better get those early bird tickets when we post about them next year. Give the account a follow and join the mailing list for updates. 

@montrealburlesquefest and @thebrownsugarburlesque appreciation post coming soon. For now, big love to @mariah.kunkel for bringing me into her grand idea and making my dreams come true 🫶🏾🫶🏾🫶🏾
